import logo from './images/meoimeoi_logo_co.png';
import LinkSection from './LinkSection';
import './meoimeoi-light-mode.css';

var LinkOptions = {
  development: {
    title: "Development",
    subtext: "Check out what I have been developing"
  }
};

function Meoi() {
  state = {
    isSelected: null,
  }
  function selectLink() {
    this.state.isSelected = true;
  }
  return (
    <div className="Meoi">
      <header className="Meoi-header">
        <img src={logo} className="Meoi-logo" alt="logo" />
        <LinkSection headerText={"Design"} isSelected={this.state.isSelected}/>
      </header>
    </div>
  );
}

export default Meoi;
